package Offer_week1;/** * @author: lingjunhao * create at:  19/4/20  下午6:00 * @description: 斐波拉契数列 */public class Solution9 {    public static long findFibonacci(int n){        if (n<=1){            return n;        }        long fibMinusOne=0;        long fibMinusTwo=1;        long fib=0;        for (int i=2;i<=n;i++){            fib=fibMinusOne+fibMinusTwo;            fibMinusOne=fibMinusTwo;            fibMinusTwo=fib;        }        return fib;    }}